import React from "react";

function ListNotes() {
  return (
    <div className="listNote">
      <ul className="flex flex-wrap  m-2 pl-2">
        <li className="note">note 1</li>
        <li className="note">note 2</li>
        <li className="note">note 2</li>
      </ul>
    </div>
  );
}

export default ListNotes;
